  render() {
    return (
      <div>

        <div className="d-flex justify-content-between" >
            <h3>Featured Stories</h3>
            <h6>Popular Stories</h6>
        </div>

        <div>
        <Container>
            <Row>
                <Col sm><Image src={pic3}  height="60px" width="60px"/></Col>
                <Col sm><Image src={pic3}  height="60px" width="60px"/></Col>
                <Col sm><Image src={pic3}  height="60px" width="60px"/></Col>
                <Col sm><Image src={pic3}  height="60px" width="60px"/></Col>
            </Row>
        </Container>
        </div>

      </div>
    )
  }
}

export default FeaturedStories;
